import React from 'react';

export default function messagingSend() {
    return (
        <div className="messagingSend">
            <form id="send">
                <textarea className="sendInput"></textarea>
                <div className="submit">Send</div>
                <div className="emojiButton"><img src="" /> </div>
            </form>
        </div>
    )
}
